import React from 'react'
import Github from "../icons/github.svg"
import image from "../images/testing.png"
const ProjectComponent = () => {
    const projectInfo = [
        {
            title: "Counterz",
            desc: "Desktop application that reports traffic data analytics.",
            skills: ["Python", "OpenCV", "Machine Learning", "Convolutional Neural Network", "Data Collection",],
            imgSrc: image,
            websiteLink: "https://braydentw.io/projects",
            codeLink: "https://braydentw.io/projects"
        }
    ]

    return (
        <div>
            {
                projectInfo.map((project) => (
                    <div>
                        <a href={project.websiteLink} target='_blank'>

                            <div className='flex justify-center border-spacing-1 border-[1px] rounded-lg border-slate-gray hover:border-blue-500 hover:border-2'>
                                <img
                                    src={project.imgSrc}
                                    width={"200px"}
                                    className='py-2 px-2'
                                />
                            </div>
                        </a>
                        <div className='flex justify-between mt-2'>
                            <a href={project.websiteLink} target='_blank'>
                                <h1 className='font-palanquin font-semibold text-blue-600 mt-1 text-md'>{project.title}</h1>
                            </a>
                            <a href={project.codeLink} target='_blank'>
                                <img src={Github} className='text-blue-600' />
                            </a>
                        </div>
                        <p className='text-sm text-slate-gray'>{project.desc}</p>
                        <div className='flex gap-2 flex-wrap mt-1'>

                            {
                                project.skills.map((skill) => (
                                    <p className='border-[1px] rounded-lg font-medium text-white font-palanquin text-sm bg-slate-400 px-2'>
                                        {skill}
                                    </p>
                                ))

                            }
                        </div>
                    </div>
                ))
            }
        </div>
    )
}

export default ProjectComponent;
